BEGIN

    DBMS_OUTPUT.PUT_LINE('[INICIO] Inicio del proceso de reposicionamiento de trámites de ofertas.');    
    DBMS_OUTPUT.PUT_LINE('');
    
     V_MSQL := 'DELETE FROM '||V_ESQUEMA||'.OFERTAS_REPOSICIONAR ';
    EXECUTE IMMEDIATE V_MSQL;
    DBMS_OUTPUT.PUT_LINE('130 trámites a reposicionar.');
    FOR I IN V_TRAMITE_CEE.FIRST .. V_TRAMITE_CEE.LAST
    	   LOOP
        	V_TMP_TRAMITE_CEE := V_TRAMITE_CEE(I);
		V_MSQL := 'SELECT PVC_ID FROM '||V_ESQUEMA||'.ACT_PVC_PROVEEDOR_CONTACTO WHERE PVE_ID = '||V_TMP_TRAMITE_CEE(3)||' AND USU_ID = '||V_TMP_TRAMITE_CEE(4);
		EXECUTE IMMEDIATE V_MSQL INTO V_PVC_ID;
DBMS_OUTPUT.PUT_LINE('120 trámites a reposicionar.');
    		V_MSQL := 'INSERT INTO '||V_ESQUEMA||'.OFERTAS_REPOSICIONAR (OFR_ID, ACT_ID, TBJ_ID, TAR_ID, TEX_ID, TRA_ID,PVC_ID)
            SELECT --OFR.OFR_ID, ECO.ECO_ID, TBJ.TBJ_ID, TAR.TAR_ID, TEX.TEX_ID, TRA.TRA_ID, TOF.DD_TOF_CODIGO, ACT.ACT_ID
                0, ACT.ACT_ID, ATB.TBJ_ID, TAR.TAR_ID, TEX.TEX_ID, TRA.TRA_ID,'||V_PVC_ID||'
            FROM '||V_ESQUEMA||'.ACT_ACTIVO ACT
            JOIN '||V_ESQUEMA||'.ACT_TBJ ATB ON ATB.ACT_ID = ACT.ACT_ID
            JOIN '||V_ESQUEMA||'.ACT_TBJ_TRABAJO TBJ ON TBJ.TBJ_ID = ATB.TBJ_ID
            JOIN '||V_ESQUEMA||'.ACT_TRA_TRAMITE TRA ON TRA.TBJ_ID = TBJ.TBJ_ID
            JOIN '||V_ESQUEMA||'.TAC_TAREAS_ACTIVOS TAC ON TAC.TRA_ID = TRA.TRA_ID
            JOIN '||V_ESQUEMA||'.TAR_TAREAS_NOTIFICACIONES TAR ON TAR.TAR_ID = TAC.TAR_ID
            JOIN '||V_ESQUEMA||'.TEX_TAREA_EXTERNA TEX ON TEX.TAR_ID = TAR.TAR_ID
            JOIN '||V_ESQUEMA||'.TAP_TAREA_PROCEDIMIENTO TAP ON TAP.TAP_ID = TEX.TAP_ID
            WHERE ACT.ACT_NUM_ACTIVO = '||V_TMP_TRAMITE_CEE(1)||' AND TRA.TRA_ID = '||V_TMP_TRAMITE_CEE(2)||'';
		EXECUTE IMMEDIATE V_MSQL;
DBMS_OUTPUT.PUT_LINE('12 trámites a reposicionar.');
	   END LOOP;
       
    V_MSQL := 'SELECT COUNT(1) FROM '||V_ESQUEMA||'.OFERTAS_REPOSICIONAR';
    EXECUTE IMMEDIATE V_MSQL INTO COUNTER;
    DBMS_OUTPUT.PUT_LINE(COUNTER||' trámites a reposicionar.');
    COUNTER := 0;

    DBMS_OUTPUT.PUT_LINE('[INFO] APROVISIONANDO LA TABLA AUXILIAR '||V_TABLA||'...');
       V_MSQL := 'DELETE FROM  '||V_ESQUEMA||'.MIG2_TRAMITES_OFERTAS_REP';
       EXECUTE IMMEDIATE V_MSQL;
      V_MSQL := '
            INSERT INTO '||V_ESQUEMA||'.MIG2_TRAMITES_OFERTAS_REP (OFR_ID, ACT_ID, TPO_ID, TAP_ID, USU_ID, SUP_ID,PVC_ID)
            SELECT 0, ORE.ACT_ID
                ,(SELECT DD_TPO_ID FROM '||V_ESQUEMA||'.DD_TPO_TIPO_PROCEDIMIENTO WHERE DD_TPO_CODIGO = ''T003'' AND BORRADO = 0)
                TPO_ID, TAP.TAP_ID, NULL AS USU_ID, NULL AS SUP_ID,ORE.PVC_ID
            FROM '||V_ESQUEMA||'.OFERTAS_REPOSICIONAR ORE
            JOIN '||V_ESQUEMA||'.TAP_TAREA_PROCEDIMIENTO TAP ON TAP.TAP_CODIGO = ''T003_EmisionCertificado'' AND BORRADO = 0';
            EXECUTE IMMEDIATE V_MSQL;
      
      DBMS_OUTPUT.PUT_LINE('[INFO] - '||to_char(sysdate,'HH24:MI:SS')||'  '||V_ESQUEMA||'.'||V_TABLA||' cargada. '||SQL%ROWCOUNT||' Filas.');

    ---------------------------------------------------------------------------------------------------------------
      -- UPDATE MIG2_TRAMITES_OFERTAS_REP (TBJ_ID, TRA_ID, TAR_ID, TEX_ID) --
      ---------------------------------------------------------------------------------------------------------------
      
      DBMS_OUTPUT.PUT_LINE('[INFO] GENERANDO TBJ_ID, TRA_ID, TAR_ID, TEX_ID...');
      
      OPEN CURSOR_OFERTAS;
      
      LOOP
            FETCH CURSOR_OFERTAS INTO V_OFR_ID;
            EXIT WHEN CURSOR_OFERTAS%NOTFOUND;
            
                  EXECUTE IMMEDIATE 'SELECT '||V_ESQUEMA||'.S_ACT_TBJ_TRABAJO.NEXTVAL FROM DUAL' INTO S_TBJ;
                  EXECUTE IMMEDIATE 'SELECT '||V_ESQUEMA||'.S_TBJ_NUM_TRABAJO.NEXTVAL FROM DUAL' INTO S_NUM;
                  EXECUTE IMMEDIATE 'SELECT '||V_ESQUEMA||'.S_ACT_TRA_TRAMITE.NEXTVAL FROM DUAL' INTO S_TRA;
                  EXECUTE IMMEDIATE 'SELECT '||V_ESQUEMA||'.S_TAR_TAREAS_NOTIFICACIONES.NEXTVAL FROM DUAL' INTO S_TAR;
                  EXECUTE IMMEDIATE 'SELECT '||V_ESQUEMA||'.S_TEX_TAREA_EXTERNA.NEXTVAL FROM DUAL' INTO S_TEX;
                  
                  EXECUTE IMMEDIATE '
                        UPDATE '||V_ESQUEMA||'.MIG2_TRAMITES_OFERTAS_REP TRA
                        SET TRA.TBJ_ID = '||S_TBJ||'
                              , TRA.TBJ_NUM_TRABAJO = '||S_NUM||'
                              , TRA.TRA_ID = '||S_TRA||'
                              , TRA.TAR_ID = '||S_TAR||'
                              , TRA.TEX_ID = '||S_TEX||'
                        WHERE ACT_ID = '||V_OFR_ID||'
                  '
                  ;
                  
      END LOOP;
      
      CLOSE CURSOR_OFERTAS; 
      
      DBMS_OUTPUT.PUT_LINE('[INFO] - '||to_char(sysdate,'HH24:MI:SS')||'  '||V_ESQUEMA||'.'||V_TABLA||' actualizada.');

     /*EXECUTE IMMEDIATE 'UPDATE '||V_ESQUEMA||'.ACT_ADT_ADJUNTO_TRABAJO ADJ
			SET ADJ.TBJ_ID=(
				SELECT MIG2.TBJ_ID 
				FROM '||V_ESQUEMA||'.OFERTAS_REPOSICIONAR OFR 
				INNER JOIN '||V_ESQUEMA||'.MIG2_TRAMITES_OFERTAS_REP MIG2 ON OFR.ACT_ID=MIG2.ACT_ID
				INNER JOIN '||V_ESQUEMA||'.ACT_ADA_ADJUNTO_ACTIVO ADA ON ADA.ACT_ID=OFR.ACT_ID				
				WHERE ADJ.ADJ_ID=ADA.ADJ_ID)';*/
    
      V_UPDATE := 0;
      EXECUTE IMMEDIATE 'MERGE INTO '||V_ESQUEMA||'.MIG2_TRAMITES_OFERTAS_REP T1
        USING (
            SELECT DISTINCT MIG.ACT_ID, GEE.USU_ID, TGE.DD_TGE_CODIGO
            FROM '||V_ESQUEMA||'.MIG2_TRAMITES_OFERTAS_REP MIG
            JOIN '||V_ESQUEMA||'.TAP_TAREA_PROCEDIMIENTO TAP ON TAP.TAP_ID = MIG.TAP_ID AND TAP.TAP_CODIGO = ''T003_EmisionCertificado''
            JOIN '||V_ESQUEMA||'.GAC_GESTOR_ADD_ACTIVO GAC ON GAC.ACT_ID = MIG.ACT_ID
            JOIN '||V_ESQUEMA||'.GEE_GESTOR_ENTIDAD GEE ON GEE.GEE_ID = GAC.GEE_ID
            JOIN REMMASTER.DD_TGE_TIPO_GESTOR TGE ON TGE.DD_TGE_ID = GEE.DD_TGE_ID AND TGE.DD_TGE_CODIGO = ''CERT'') T2
        ON (T1.ACT_ID = T2.ACT_ID)
        WHEN MATCHED THEN UPDATE SET
            T1.USU_ID = T2.USU_ID';
      V_UPDATE := SQL%ROWCOUNT;     

      DBMS_OUTPUT.PUT_LINE('[INFO] - '||to_char(sysdate,'HH24:MI:SS')||'  '||V_ESQUEMA||'.'||V_TABLA||' actualizada (Gestor de certificación). '||V_UPDATE||' Filas.');

    DBMS_OUTPUT.PUT_LINE('[INFO] COMIENZA EL VOLCADO A LAS TABLAS DEFINITIVAS');
      
      DBMS_OUTPUT.PUT_LINE('[INFO] CREANDO TRABAJOS...');
      
      EXECUTE IMMEDIATE '
            INSERT INTO '||V_ESQUEMA||'.'||V_TABLA_TBJ||' (
                  TBJ_ID
                  , ACT_ID
                  , TBJ_NUM_TRABAJO
		  , PVC_ID
		  , TBJ_CUBRE_SEGURO
		  , TBJ_TARIFICADO
		  , TBJ_FECHA_APROBACION
                  , USU_ID
                  , DD_TTR_ID
                  , DD_STR_ID
                  , DD_EST_ID
                  , TBJ_FECHA_SOLICITUD
                  , VERSION
                  , USUARIOCREAR
                  , FECHACREAR
                  , BORRADO
            )
            SELECT DISTINCT
                  MIG2.TBJ_ID                                             AS TBJ_ID
                  , MIG2.ACT_ID                                           AS AGR_ID
                  , MIG2.TBJ_NUM_TRABAJO                         AS TBJ_NUM_TRABAJO
		  , MIG2.PVC_ID
		  , 0
		  , 1
		  , TRUNC(SYSDATE)
		  , (SELECT USU_ID
                          FROM '||V_ESQUEMA_M||'.USU_USUARIOS
                          WHERE USU_USERNAME = ''MIGRACION''
                          AND BORRADO = 0
                    )                                                          AS USU_ID 
                  , (SELECT DD_TTR_ID
                          FROM '||V_ESQUEMA||'.DD_TTR_TIPO_TRABAJO
                          WHERE DD_TTR_CODIGO = ''02''
                          AND BORRADO = 0
                    )                                                           AS DD_TTR_ID    
                  , (SELECT DD_STR_ID FROM '||V_ESQUEMA||'.DD_STR_SUBTIPO_TRABAJO WHERE DD_STR_CODIGO = ''18'' AND BORRADO = 0)   
                        
                  , (SELECT DD_EST_ID
                          FROM '||V_ESQUEMA||'.DD_EST_ESTADO_TRABAJO
                          WHERE DD_EST_CODIGO = ''04''
